import React from 'react';

function Resume() {
  const containerStyle = {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    height: '100vh', // Center vertically in the viewport
  };

  const embedStyle = {
    width: '70%',
    height: '1000px',
  };

  return (
    <div style={containerStyle}>
      <div>
        <a href="objects/resume.pdf" download>Download my resume!</a>
        <embed src="objects/resume.pdf" style={embedStyle} type="application/pdf" />
      </div>
    </div>
  );
}

export default Resume;
